# https://leetcode.com/explore/featured/card/may-leetcoding-challenge/536/week-3-may-15th-may-21st/3330/

##### Calculating the left->right sum array and right->left sum array. Then using the sliding window approach.
class Solution:
    def maxSubarraySumCircular(self, A: List[int]) -> int:
        max_sum = A[0]
        temp = A[0]
        prev = 0

        ####### CASE 1: Kadane's algorithm
        for i in range(1, len(A)):
            temp = max(A[i], temp + A[i])
            max_sum = max(max_sum, temp)
        

        ####### CASE 2: Sliding window approach
        copy = A.copy()
        prev = 0
        for i in range(len(copy)-1, -1, -1):
            copy[i] = copy[i] + prev
            prev = copy[i]
        
        prev = 0
        for i in range(len(A)):
            A[i] = A[i] + prev    
            prev = A[i]
            
        for i in range(1, len(A)):
            if A[i-1] > A[i]:
                A[i] = A[i-1]
        
        for i in range(1, len(copy)):
            max_sum = max(max_sum, copy[i] + A[i-1])
        
        return max_sum